def get_labels(list_of_images, labels_file): 
  #create empty list for the labels
  #for every image from the list, find its label
  #add the label to the labels list
  #return the labels list
  labels_list = [] 
  for image_name in list_of_images:
    with open(labels_file) as csv_file:
      csv_reader = csv.reader(csv_file, delimiter=',')
      for row in csv_reader:
          if(len(row)>0):
            if(row[0] + ".jpeg" == image_name):
              labels_list.append(int(row[1]))
            elif(row[0] + ".jpg" == image_name):
              labels_list.append(int(row[1]))
            elif(row[0] + ".png" == image_name):
              labels_list.append(int(row[1]))
      if ("369_4" in image_name):
         labels_list.append(1)
  return labels_list





